CREATE TABLE chan_sat(
channel_name INT,
sat_name INT,
prov_pack VARCHAR(50),
frequency VARCHAR(10),
CONSTRAINT PK PRIMARY KEY (channel_name, sat_name, frequency)
);

CREATE TABLE channels(
name VARCHAR(50) PRIMARY KEY,
encryption VARCHAR(50),
vid_encode VARCHAR(50),
FEC VARCHAR(5),
SR VARCHAR(10)
);

CREATE TABLE satellite(
name VARCHAR(50) PRIMARY KEY,
launch_date date,
launch_rkt VARCHAR(50),
region VARCHAR(50),
pos VARCHAR(8),
EIRP VARCHAR(6),
sys VARCHAR(20), 
beam VARCHAR(20)
);

CREATE TABLE user(
username VARCHAR(50) PRIMARY KEY,
email VARCHAR(100) UNIQUE,
region VARCHAR(50),
location VARCHAR(50),
birthdate DATE,
gender VARCHAR(6)
, pass VARCHAR(50) NOT NULL);

CREATE TABLE chan_lang(
name INT, 
lang VARCHAR(10),
CONSTRAINT PK PRIMARY KEY (name, lang)
);

CREATE TABLE fave_channel(
username VARCHAR(50),
channel_name VARCHAR(50),
CONSTRAINT PK PRIMARY KEY (username, channel_name)
);

